        "es": {
          "title": "LA DIOSA VIVA DE NEPAL: niña poseída por una deidad 🇳🇵",
          "description": "En Nepal existe una tradición milenaria que venera a una diosa viviente, una niña llamada: Kumari.\n🌟 Agradecimiento especial al patrocinador del episodio \"Gimme5\", mi alcancía digital. Y con este código: HAPPY5 tendrás 5€ para empezar a ahorrar con conciencia. https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nEs prácticamente imposible convertirse en uno: el elegido debe ser un niño virgen que nunca haya sangrado en su vida, que nunca haya perdido un solo diente de leche y debe respetar 32 rasgos estéticos. Sin embargo, la vida de una Kumari no es nada fácil. Ya no podrá tocar el suelo con los pies, ni salir de casa salvo en celebraciones especiales hasta su primer ciclo menstrual, cuando el espíritu de la Diosa Durga dejará su cuerpo para elegir a otra chica.\nVolé a Katmandú para conocerla y contarles esta increíble historia.\n¡Buena visión!\n\n❤️ Quiero agradecer tanto a Manisha Mhrzn (https://www.instagram.com/devillinamhrzn/) y John Malakha (https://www.instagram.com/john.malakha/) porque sin ellos no habría podido entrar en contacto con la familia de Kumari, y además han sido invaluables compañeros de aventuras. ¡Gracias chicos!\n\nSigue mis aventuras también en Instagram: http://bit.ly/Instagram_PH\n\n\n⚡️ PROYECTO EQUIPO FELICIDAD ⚡️\n• FOTOGRAFÍA Y EDICIÓN: Nicola Guaita\n• MONTAJE: Gianmarco Garimberti\n• DISEÑO DE SONIDO: Lorenzo Sattin\n\n#katmandú #kumari #misterio"
        },
        "el": {
          "title": "Η ΖΩΝΤΑΝΗ ΘΕΑ ΤΟΥ ΝΕΠΑΛ: παιδί κυριευμένο από μια θεότητα 🇳🇵",
          "description": "Στο Νεπάλ υπάρχει μια χιλιετή παράδοση που λατρεύει μια ζωντανή θεά, ένα μικρό κορίτσι που ονομάζεται: Kumari.\n🌟 Ιδιαίτερες ευχαριστίες απευθύνονται στον χορηγό του επεισοδίου «Gimme5», τον ψηφιακό μου κουμπαρά. Και με αυτόν τον κωδικό: HAPPY5 θα έχετε 5€ για να ξεκινήσετε να εξοικονομείτε με επίγνωση. https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nΕίναι πρακτικά αδύνατο να γίνεις: η εκλεκτή πρέπει να είναι ένα παρθένο παιδί που δεν έχει αιμορραγήσει ποτέ στη ζωή του, που δεν έχει χάσει ούτε ένα δόντι γάλακτος και πρέπει να σέβεται 32 αισθητικά χαρακτηριστικά. Ωστόσο, η ζωή ενός Κουμάρι δεν είναι καθόλου εύκολη. Δεν θα μπορεί πλέον να αγγίζει το έδαφος με τα πόδια της, ούτε να βγαίνει από το σπίτι παρά μόνο για ειδικούς εορτασμούς μέχρι τον πρώτο της έμμηνο κύκλο, όταν το πνεύμα της θεάς Durga θα αφήσει το σώμα της για να επιλέξει ένα άλλο κορίτσι.\nΠέταξα στο Κατμαντού για να τη συναντήσω και να σας πω αυτή την απίστευτη ιστορία.\nΚαλή όραση!\n\n❤️ Θέλω να ευχαριστήσω τόσο πολύ τους Manisha Mhrzn (https://www.instagram.com/devillinamhrzn/) & John Malakha (https://www.instagram.com/john.malakha/) γιατί χωρίς αυτούς δεν θα είχα μπόρεσαν να έρθουν σε επαφή με την οικογένεια του Kumari, και επιπλέον ήταν ανεκτίμητοι σύντροφοι περιπέτειας. Σας ευχαριστώ παιδιά!\n\nΑκολουθήστε τις περιπέτειές μου και στο Instagram: http://bit.ly/Instagram_PH\n\n\n⚡️ ΕΡΓΟ ΟΜΑΔΑΣ ΕΥΤΥΧΙΑΣ ⚡️\n• ΦΩΤΟΓΡΑΦΙΑ & ΜΟΝΤΑΖ: Nicola Guaita\n• ΜΟΝΤΑΖ: Gianmarco Garimberti\n• ΣΧΕΔΙΑΣΜΟΣ ΗΧΟΥ: Lorenzo Sattin\n• ΜΕΤΑΦΡΑΣΕΙΣ ENG-ITA: Kayla Baker\n\n#Κατμαντού #κουμάρι #μυστήριο"
        },
        "it": {
          "title": "LA DEA BAMBINA DEL NEPAL: bimba di 6 anni posseduta da una divinità 🇳🇵",
          "description": "In Nepal esiste una tradizione millenaria che venera una dea vivente, una bambina chiamata: Kumari.\n🌟 Ringraziamento speciale va allo sponsor dell'episodio \"Gimme5\", il mio salvadanaio digitale. E con questo codice: HAPPY5 avrete 5€ per iniziare a risparmiare con consapevolezza. https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nÈ praticamente impossibile diventarlo: la prescelta dev’essere una bambina vergine che non ha mai sanguinato nella sua vita, che non ha mai perso nemmeno un dente da latte e deve rispettare 32 tratti estetici. La vita di una Kumari però non è per niente facile. Non potrà più toccare terra con i piedi, ne uscire di casa se non per celebrazioni speciali fino al suo primo ciclo mestruale, quando lo spirito della Dea Durga lascerà il suo corpo per scegliere un’altra bambina.\nIo sono volato fino in Kathmandu per incontrarla e raccontarvi questa incredibile storia.\nBuona visione!\n\n❤️ Ci tengo a ringraziare tanto Manisha Mhrzn (https://www.instagram.com/devillinamhrzn/) & John Malakha (https://www.instagram.com/john.malakha/) perchè senza di loro non sarei riuscito a entrare in contatto con la famiglia della Kumari, e oltre a questo sono stati dei preziosissimi compagni d'avventura. Grazie ragazzi! \n\nSegui le mie avventure anche su Instagram: http://bit.ly/Instagram_PH \n\n\n⚡️PROGETTO HAPPINESS TEAM⚡️\n• FOTOGRAFIA & EDITING: Nicola Guaita\n• EDITING: Gianmarco Garimberti\n• SOUND DESIGN: Lorenzo Sattin\n• TRADUZIONI ENG-ITA: Kayla Baker\n\n#kathmandu #kumari #mistero"
        },
        "en": {
          "title": "THE LIVING GODDESS OF NEPAL: girl possessed by a deity who can't touch the ground with her feet🇳🇵",
          "description": "In Nepal there is a millenary tradition that venerates a living goddess, a little girl called: Kumari.\n🌟 Special thanks goes to the sponsor of the episode \"Gimme5\", my digital piggy bank. And with this code: HAPPY5 you will have €5 to start saving with awareness. https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nIt is practically impossible to become one: the chosen one must be a virgin child who has never bled in her life, who has never lost a single milk tooth and must respect 32 aesthetic traits. However, the life of a Kumari is not easy at all. She will no longer be able to touch the ground with her feet, nor leave the house except for special celebrations until her first menstrual cycle, when the spirit of the Goddess Durga will leave her body to choose another girl.\nI flew to Kathmandu to meet her and tell you this incredible story.\nGood vision!\n\n❤️ I want to thank Manisha Mhrzn (https://www.instagram.com/devillinamhrzn/) & John Malakha (https://www.instagram.com/john.malakha/) so much because without them I wouldn't have been able to enter in contact with Kumari's family, and in addition to this they have been invaluable adventure companions. Thank you guys!\n\nFollow my adventures also on Instagram: http://bit.ly/Instagram_PH\n\n\n⚡️ HAPPINESS TEAM PROJECT ⚡️\n• PHOTOGRAPHY & EDITING: Nicola Guaita\n• EDITING: Gianmarco Garimberti\n• SOUND DESIGN: Lorenzo Sattin\n• ENG-ITA TRANSLATIONS: Kayla Baker\n\n#kathmandu #kumari #mystery"
        },
        "hi": {
          "title": "नेपाल की जीवित देवी: एक देवता के कब्जे वाला बच्चा 🇳🇵",
          "description": "नेपाल में एक सहस्राब्दी परंपरा है जो एक जीवित देवी की पूजा करती है, एक छोटी लड़की जिसे कुमारी कहा जाता है।\n🌟 मेरे डिजिटल गुल्लक \"Gimme5\" एपिसोड के प्रायोजक को विशेष धन्यवाद। और इस कोड के साथ: HAPPY5 जागरूकता के साथ बचत शुरू करने के लिए आपके पास €5 होगा। https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nएक बनना व्यावहारिक रूप से असंभव है: चुना गया एक कुंवारी बच्चा होना चाहिए जिसने अपने जीवन में कभी खून नहीं बहाया हो, जिसने कभी दूध का एक भी दांत नहीं खोया हो और उसे 32 सौंदर्य लक्षणों का सम्मान करना चाहिए। हालाँकि, कुमारी का जीवन बिल्कुल भी आसान नहीं होता है। वह अब अपने पैरों से जमीन को छूने में सक्षम नहीं होगी, न ही अपने पहले मासिक धर्म तक विशेष उत्सवों को छोड़कर घर से बाहर निकलेगी, जब देवी दुर्गा की आत्मा दूसरी लड़की को चुनने के लिए उसके शरीर को छोड़ देगी।\nमैं उनसे मिलने और आपको यह अविश्वसनीय कहानी सुनाने के लिए काठमांडू गया।\nअच्छी दृष्टि!\n\n❤️ मैं मनीषा मह्रजन (https://www.instagram.com/devillinamhrzn/) और जॉन मलाखा (https://www.instagram.com/john.malakha/) को बहुत-बहुत धन्यवाद देना चाहता हूं क्योंकि उनके बिना मेरे पास नहीं होता कुमारी के परिवार के संपर्क में आने में सक्षम हुए, और इसके अलावा वे अमूल्य साहसिक साथी रहे हैं। आप लोगों को धन्यवाद!\n\nमेरे कारनामों को इंस्टाग्राम पर भी फॉलो करें: http://bit.ly/Instagram_PH\n\n\n⚡️ खुशी टीम परियोजना ⚡️\n• फोटोग्राफी और संपादन: निकोला गुइता\n• संपादन: जियानमार्को गरीमबर्टी\n• ध्वनि डिजाइन: लोरेंजो सैटिन\n\n#काठमांडू #कुमारी #रहस्य"
        },
        "ne": {
          "title": "नेपालकी जीवित देवी: देवताले बोकेको बच्चा 🇳🇵",
