          "description": "No Nepal existe uma tradição milenar que venera uma deusa viva, uma garotinha chamada: Kumari.\n🌟 Agradecimento especial ao patrocinador do episódio \"Gimme5\", meu cofrinho digital. E com este código: HAPPY5 terá 5€ para começar a poupar com consciência. https://5gimme5.acomea.it/app/register?hidden=P-0ouj43dff21wi5fsnmm3co7u5rr3lm70\nÉ praticamente impossível se tornar um: o escolhido deve ser uma criança virgem que nunca sangrou na vida, que nunca perdeu um dente de leite e deve respeitar 32 traços estéticos. No entanto, a vida de um Kumari não é nada fácil. Ela não poderá mais tocar o chão com os pés, nem sair de casa exceto para comemorações especiais até a primeira menstruação, quando o espírito da Deusa Durga deixará seu corpo para escolher outra menina.\nVoei para Kathmandu para conhecê-la e contar esta incrível história.\nBoa visão!\n\n❤️ Quero agradecer muito a Manisha Mhrzn (https://www.instagram.com/devillinamhrzn/) e John Malakha (https://www.instagram.com/john.malakha/) porque sem eles eu não teria puderam entrar em contato com a família de Kumari e, além disso, foram inestimáveis \u200b\u200bcompanheiros de aventura. Obrigado pessoal!\n\nAcompanhe minhas aventuras também no Instagram: http://bit.ly/Instagram_PH\n\n\n⚡️ PROJETO EQUIPE FELICIDADE ⚡️\n• FOTOGRAFIA E EDIÇÃO: Nicola Guaita\n• EDIÇÃO: Gianmarco Garimberti\n• DESIGN DE SOM: Lorenzo Sattin\n\n#kathmandu #kumari #mistério"
