        "description": "C’est ce que l’on appelle la loi des séries. Il y a un mois sur l’aéroport de Luxembourg-Findel, l’un des réacteurs d’un Boeing 747 de Cargolux avait touché la piste en se posant. Ce dimanche 14 mai 2023, sur ce même aéroport, un autre Boeing 747 de Cargolux a perdu l’un de ses quatre trains principaux à l’atterrissage. \n\nL’avion cargo avait décollé à 18H10 pour Chicago mais l’équipage n’est pas parvenu à rentrer les trains de l’avion. Pour revenir se poser en toute sécurité, les pilotes ont donc procédé à une vidange carburant. Mais au moment du toucher des roues, à 18H52, le train d'atterrissage droit s’est détaché de l’avion et les 4 pneus qui le compose ont touché le fuselage avant de rebondir plusieurs fois. L'avion s'est immobilisé quelques centaines de mètres plus loin sur la piste. Personne n'a été blessée mais l’aéroport a dû être fermé pendant six heures. \n\nOn ignore pour l’instant ce qui a pu provoquer la cassure du train. Une enquête à été ouverte.",
